import express from 'express';
import { graphqlHTTP } from 'express-graphql';
import schema from './schema';

const app = express();

app.get('/', (req, res) => {
	res.json('Sick & sad world');
});

app.use(
	'/graphql',
	graphqlHTTP({
		graphiql: true,
		schema: schema,
	})
);

app.listen(3000, () => {
	console.log('====================================');
	console.log('Server on port 3000');
	console.log('====================================');
});

